import classes from './Checkout.module.css';
import {z} from "zod";
import {useForm} from "react-hook-form";
import {zodResolver} from "@hookform/resolvers/zod"
import React from "react";

const FormSchema = z.object({
    name: z.string(),
    street: z.string(),
    postalCode: z.number(),
    city: z.string()
})

const Checkout = (props) => {

    const {register, watch, handleSubmit,
        formState,
    } = useForm({
        resolver: zodResolver(FormSchema)
    });

    React.useEffect(() => {
        console.log("touchedFields", formState.touchedFields);
    },[formState]);

    const onSubmit = (data) => {
        console.log(data)
    };
   console.log(onSubmit)

    return (
        <form className={classes.form} onSubmit={handleSubmit(onSubmit)}>
            <div className={classes.control}>
                <label htmlFor='name'>Your Name</label>
                <input type='text' id='name' {...register("name")} />
            </div>
            <div className={classes.control}>
                <label htmlFor='street'>Street</label>
                <input type='text' id='street'{...register("street")} />
            </div>
            <div className={classes.control}>
                <label htmlFor='postal'>Postal Code</label>
                <input type='number' id='postal' {...register("postalCode")}/>
            </div>
            <div className={classes.control}>
                <label htmlFor='city'>City</label>
                <input type='text' id='city'{...register("city")}/>
            </div>
            <pre>{JSON.stringify(watch(), null, 2)}</pre>
            <div className={classes.actions}>
                <button type='button' onClick={props.onCancel}>
                    Cancel
                </button>
                <button type='submit' className={classes.submit}>Confirm</button>
            </div>
        </form>
    );
};

export default Checkout;
